<template>
  <div class="routerview">
    <h3>蚂蚁税服-C端开票业务梳理</h3>
    <p class="h4">立项目的</p>
    实现付费用户,每月申请发票,查看往期发票等线上SAAS功能.<br><br>
    未来C端客户增加,针对贵州方面的会计以及出纳业务会产生大量的报税相关的业务现金流,仅仅通过手动记账方式,将会占用很多的人力成本. <br>
    <br>
    为了解决该问题,针对C端付费用户设计一套申请发票,计算税点,付款以及查看发票等业务流程.<br>
    <br>
    对应A端,实现财务可查C端用户开取发票,往期开取发票等业务.<br><br>
    <p class="h4">系统主要功能及实现</p>
      <h5>C端模块</h5>
      (1)付费展示发票申请页面;<br><br>
      <!-- (2)按月份(或季度/业务流程确定再进行修整)申请发票金额;<br><br> -->
      (2)个人资料展示+上传新的资料;<br><br>
      (3)申请发票业务;<br><br>
      (4)往期票务展示;<br><br>
      
